    /**
     * Gets the attribute value for the calculated attribute TransPoIdNo.
     * @return the TransPoIdNo
     */
    public String getTransPoIdNo() {
        if (getDocIdPo() != null) {
            MmIpoIdfAMImpl am = (MmIpoIdfAMImpl) this.getApplicationModule();
            am.getLovPoIdForDisp().setNamedWhereClauseParam("BindSlocId", getSlocId());
            am.getLovPoIdForDisp().setNamedWhereClauseParam("BindCldId", getCldId());
            am.getLovPoIdForDisp().setNamedWhereClauseParam("BindOrgId", getOrgId());
            am.getLovPoIdForDisp().setNamedWhereClauseParam("BindDocId", getDocIdPo());
            am.getLovPoIdForDisp().executeQuery();
            Row r[] = am.getLovPoIdForDisp().getFilteredRows("DocId", getDocIdPo());
            if (r.length > 0) {
                return r[0].getAttribute("AuthPoNo").toString();
            } else {

                return (String) getAttributeInternal(TRANSPOIDNO);
            }
        } else {
            return (String) getAttributeInternal(TRANSPOIDNO);
        }
    }

